CREATE PROCEDURE `AgregarAlCarrito` (IN `p_id_empleado` INT, IN `p_id_producto` INT, IN `p_cantidad` INT)   BEGIN
    DECLARE v_stock INT DEFAULT 0;
    DECLARE v_cantidad_actual INT DEFAULT 0;
    DECLARE v_cantidad_total INT DEFAULT 0;

    SELECT stock INTO v_stock FROM Productos WHERE idProducto = p_id_producto;

    SELECT Cantidad INTO v_cantidad_actual 
    FROM Temp_Ventas 
    WHERE idEmpleado = p_id_empleado AND idProducto = p_id_producto;

    IF v_cantidad_actual IS NULL THEN
        SET v_cantidad_actual = 0;
    END IF;

    SET v_cantidad_total = v_cantidad_actual + p_cantidad;

    IF v_cantidad_total <= v_stock THEN
        VALUES (p_id_empleado, p_id_producto, p_cantidad)
        ON DUPLICATE KEY UPDATE Cantidad = Cantidad + p_cantidad;
    ELSE
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Cantidad solicitada excede el stock disponible.';
    END IF;
END$$

CREATE PROCEDURE `AgregarEmpleado` (IN `p_Nombre` VARCHAR(50), IN `p_Paterno` VARCHAR(50), IN `p_Materno` VARCHAR(50), IN `p_Telefono` VARCHAR(10), IN `p_Email` VARCHAR(50), IN `p_Edad` SMALLINT, IN `p_Sexo` ENUM('H','M'), IN `p_Calle` VARCHAR(50), IN `p_Numero` INT, IN `p_CP` INT, IN `p_Puesto` ENUM('Administrador','Cajero','Agente de Venta'), IN `p_RFC` VARCHAR(13), IN `p_NumeroSeguroSocial` VARCHAR(11), IN `p_Usuario` VARCHAR(255), IN `p_Contrasena` VARCHAR(255))   BEGIN
    DECLARE v_idDomicilio INT;
    DECLARE v_idPersona INT;

    -- Manejador simple para errores de SQL
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Error al registrar el empleado. Datos duplicados o problema con la inserción.';
    END;

    -- Validación: Teléfono o Email ya existen
    IF EXISTS (
        SELECT 1 FROM Personas WHERE Telefono = p_Telefono OR Email = p_Email
    ) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Teléfono o Email ya registrados';
    END IF;

    -- Validación: Usuario ya existe
    IF EXISTS (
        SELECT 1 FROM Empleados WHERE Usuario = p_Usuario
    ) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Usuario ya registrado';
    END IF;

    START TRANSACTION;

        -- Insertar en Domicilios
        VALUES (p_Calle, p_Numero, p_CP);
        SET v_idDomicilio = LAST_INSERT_ID();

        -- Insertar en Personas
            Nombre, Paterno, Materno, Telefono, Email, Edad, Sexo, Estatus, idDomicilio
        ) VALUES (
            p_Nombre, p_Paterno, p_Materno, p_Telefono, p_Email, p_Edad, p_Sexo, 'Activo', v_idDomicilio
        );
        SET v_idPersona = LAST_INSERT_ID();

        -- Insertar en Empleados
            Puesto, RFC, NumeroSeguroSocial, Usuario, Contraseña, idPersona
        ) VALUES (
            p_Puesto, p_RFC, p_NumeroSeguroSocial, p_Usuario, p_Contrasena, v_idPersona
        );

    COMMIT;
END$$

